operations.content:
mutation AddMessage($email: String! @fromClaim(name: EMAIL), $name: String! @fromClaim(name: NAME), $message: String!) {
  createOnemessages(
    data: {message: $message, users: {connectOrCreate: {create: {name: $name, email: $email}, where: {email: $email}}}}
  ) {
    id
    message
  }
}

query Messages {
  findManymessages(take: 20, orderBy: [{id: desc}]) {
    id
    message
    users {
      id
      name
    }
  }
}

customDatabase.prismaSchema:
datasource db {
  provider = "postgresql"
  url      = "postgresql://admin:admin@localhost:54322/example?schema=public"
}

model messages {
  id      Int    @id @default(autoincrement())
  user_id Int
  message String
  users   users  @relation(fields: [user_id], references: [id])
}

model users {
  id       Int        @id @default(autoincrement())
  email    String     @unique
  name     String
  messages messages[]
}
